import React from "react";
import {AccordionComponent} from "./accordion_component/AccordionComponent";
import {Auto_icon} from '@src/components/elements/icons';


export const AncmntAutoForm = (props) => {
    const {} = props;

    return (
        <div>
            <AccordionComponent
                icon={Auto_icon}
                title='Автомобиль'
            />
        </div>
    )
};
